import React ,{ useState } from "react"
import Adder from "./adder"


function Inter(){
    var t=0;
    function test(ind){
         t = ind;
         console.log(t)

    }

    const New=[<Adder  key={0} id={0} Test={test} />,
        <Adder  key={1} id={1} Test={test} />,
        <Adder  key={2} id={2} Test={test} />,
        <Adder  key={3} id={3} Test={test} />]
    return <div>
    {New.filter((index)=> t!==index)} }
     <Adder />
    </div>
    
}

export default Inter
